INSERT INTO `feedbacks` VALUES (5,3,'2024-08-19 10:15:27','Estoy muy satisfecho con la atención y el profesionalismo que recibí. Siempre estuviste disponible para responder mis preguntas y me sentí acompañado durante todo el proceso. Tu conocimiento del caso fue fundamental para obtener un buen resultado.',5),(5,4,'2024-08-18 10:20:11','Aprecio mucho el esfuerzo que pusiste en mi caso. Sin embargo, creo que podrías mejorar la comunicación. A veces, me sentía un poco perdido entre las reuniones y no siempre recibía actualizaciones sobre el avance. Un informe semanal podría ayudar a mantenerme informado.',4);
