INSERT INTO `notas` VALUES (1,3,'2024-07-12 10:15:45','Avance en la Recolección de Pruebas','Hasta la fecha, hemos logrado obtener varios documentos clave que respaldan nuestra posición, incluidos correos electrónicos y contratos relevantes. Además, se han identificado tres nuevos testigos que pueden proporcionar información crucial sobre los hechos del caso. Las entrevistas con estos testigos están programadas para la próxima semana. Se sugiere continuar revisando la documentación relacionada para detectar cualquier otro material que pueda ser útil.'),(2,3,'2024-07-04 08:15:45','Entrevista con Testigo Clave','Se realizó con éxito la entrevista al testigo principal. Su declaración aporta nueva evidencia que podría ser determinante en el desarrollo del caso.'),(3,4,'2024-07-15 08:22:45','Progreso en las Negociaciones','Las negociaciones con la parte contraria han avanzado lentamente, con una propuesta inicial de acuerdo que no satisface nuestros objetivos. Sin embargo, hemos recibido comentarios constructivos sobre los puntos de disputa. Se planea programar una reunión para la próxima semana con la intención de presentar una contraoferta más sólida. Es fundamental estar preparados para discutir las condiciones que consideramos innegociables para avanzar hacia un acuerdo que beneficie a nuestro cliente.');
/*!40000 ALTER TABLE `notas` ENABLE KEYS */;
UNLOCK TABLES;

