INSERT INTO `noticias` VALUES (1,'Corte Suprema Confirma Uso de Glifosato en Agricultura: Fallo a Favor de Productores','La Corte Suprema de Justicia de Argentina emitió un fallo decisivo en octubre de 2024 que confirma la legalidad del uso de glifosato en la producción agrícola...','2024-02-06','2024-03-02'),(2,'Bonificación Extraordinaria para Pensionados: Medida para Combatir la Pérdida de Poder Adquisitivo','En octubre de 2024, la Administración Nacional de la Seguridad Social (ANSES) anunció un bono extraordinario de hasta $70,000 para los pensionados de menores ingresos...','2024-07-26','2024-08-26'),(3,'Nuevo Bono Extraordinario para Jubilados en Octubre 2024: ANSES Compensa la Pérdida del Poder Adquisitivo','El gobierno argentino ha decretado la entrega de un bono extraordinario de hasta $70,000 para jubilados y pensionados durante el mes de octubre de 2024...','2024-05-26','2024-06-02');
